import './musique.css';
import icoSoundcloud from '../global/Footer/ico/icoSoundcloud.svg';

function Musique() {


  return (
    
    <div className='container_global'>




     <div className="div_musique">

        <h1 className='intro_musique'>Retrouvez tous les sons du label</h1>
        <h2 className='intro_musique'>Retrouvez tous les sons du label</h2>
          <div className='container'>

          <span className="container_ico"></span>
            <span className='fond_ico'>
              <img className='ico' src={icoSoundcloud}/>

            </span>
            <span className='fond_ico'></span>
            <span className='fond_ico'></span>
          </div>


      </div> 




    </div>
    
  );
}

export default Musique;
// export { totalArticle };
